import PropTypes from 'prop-types';
import CreateCardModal from '../CreateCardModal/CreateCardModal';
import React from 'react';

const CreateCard = props => {
    const { isShowModal, setIsShowModal, ...createCardProps } = props;

    return (
        <>
            <div
                className='rounded-xl border border-dashed border-gray-400 p-5 flex justify-center items-center cursor-pointer w-full sm:w-5/12 lg:w-3/12 h-36'
                onClick={() => setIsShowModal(!isShowModal)}
            >
                <span className='text-4xl text-gray-400 font-thin'>+</span>
            </div>
            <CreateCardModal isShowModal={isShowModal} setIsShowModal={setIsShowModal} />
        </>
    );
};

CreateCard.propTypes = {};

export default CreateCard;
